import styled from "styled-components";
import { MenuBar } from "../components/menuBar";
import ProductSearchView from "../components/productSearchView";
import SearchBar from "../components/searchBar";

const Container = styled.div`
    margin-top: 72px;
    left: 0;
    right: 0;
    margin: 72px auto;
    max-width: 768px;
    display: flex;
    flex-direction: column;
    justify-content: center;
`

const ProductsShowcase = styled.div`
    width: 100%;
    margin-top: 80px;
    display: flex;
    flex-direction: column;
    padding: 16px;
`

export default function Marketplace () {
    return <MenuBar viewSearch={false} position={'marketplace'}>
        <Container>
            <SearchBar allowFilter={true} style={{ top: '80px', position: 'sticky' }}/>
